css:
.conflict-resolved {
  background: rgba(0, 0, 0, 0.1);
}
.conflict-ours {
  background: #86dfad;
}
.conflict-ours.cursor-line {
  background: #5dd491;
}
.conflict-theirs {
  background: #7ac6fa;
}
.conflict-theirs.cursor-line {
  background: #49b1f7;
}
.conflict-dirty {
  background: #433d03;
}
.conflict-dirty.cursor-line {
  background: #746a05;
}
